JingleSession.prototype.contentUpdateOffer = function(sdp, streamType, actionType) {
    try {
        Strophe.log("", '[Strophe.jingle] contentUpdateOffer', sdp.sdp);

        var self = this;
        this.localSDP = new SDP(sdp.sdp);

        if (streamType === "audio") {
            self.localType = "audio";
        }
        else if (streamType === "video") {
            self.localType = "audio+video";
        }
        else if (streamType === "sharing") {
            self.localType = "sharing";
        }
        else if (streamType === "sharing+video") {
            self.localType = "sharing+video";
        }

        var init = $iq({
            to: this.peerjid,
            type: 'set'
        })
            .c('jingle', {
                xmlns: 'urn:xmpp:jingle:1',
                action: 'content-' + actionType,
                initiator: this.initiator,
                sid: this.sid,
                mediaType: streamType
            });

        if (this.calledNumber && this.calledNumber !== "") {//callednumber for webrtcGateway-mediaPillar
            init = init.c('mediapillar', { xmlns: 'urn:xmpp:janus:1' })
                .c('callednumber')
                .t(this.calledNumber);
            init.up();
            init.up();
        }

        this.localSDP.toJingle(init, this.initiator == this.me ? 'initiator' : 'responder', this.conference_id);
        this.connection.sendIQ(init,
            function() {
                var ack = {};
                ack.source = 'offer';
                $(document).trigger('ack.jingle', [self.sid, ack]);
            },
            function(stanza) {
                self.state = 'error';
                if (self.peerconnection) {
                    Strophe.log("", '[Strophe.jingle] Clear peerconnection');
                    self.peerconnection.close();
                    self.peerconnection = null;
                }

                var error = ($(stanza).find('error').length) ? {
                    code: $(stanza).find('error').attr('code'),
                    reason: $(stanza).find('error :first')[0].tagName,
                } : {};
                error.source = 'offer';
                $(document).trigger('error.jingle', { sid: self.sid, error: error });
            },
            this.jingleIqTimeout);

        sdp.sdp = this.localSDP.raw;
        this.peerconnection.setLocalDescription(sdp,
            function() {
                $(document).trigger('setLocalDescription.jingle', [self.sid]);
                Strophe.log("", '[Strophe.jingle] setLocalDescription success');
            },
            function(e) {
                Strophe.log(Strophe.LogLevel.ERROR, '[Strophe.jingle] setLocalDescription failed', e);
            }
        );
    } catch (error) {
        Strophe.log(Strophe.LogLevel.ERROR, '[Strophe.jingle] JingleSession.prototype.contentUpdateOffer failed: ' + error);
    }
};

