JingleSession.prototype.updateBandwidthRestriction = function(sdp, isConference, isMobile) {
    "use strict";

    //if mobile or conference, limit the video quality to 500
    var bandwidth = (isConference || isMobile) ? 500 : 1200;

    if (this.localType === "audio" || isConference) {
        Strophe.log("", '[Strophe.jingle] do not updateBandwidthRestriction');
        return sdp;
    }

    if (this.localType === "sharing" || this.remoteType === "sharing") {
        bandwidth = (isConference || isMobile) ? 800 : 1500;
    }

    if (this.localType === "sharing+video") {
        bandwidth = isMobile ? 1300 : 2700;
    }

    var modifier = 'AS';
    if (adapter.default.browserDetails.browser === 'firefox') {
        bandwidth = (bandwidth >>> 0) * 1000;
        modifier = 'TIAS';
    }

    if (bandwidth > 0) {
        if (sdp.indexOf('b=' + modifier + ':') === -1) {
            var indexOfVideo = sdp.indexOf('m=video');
            if (indexOfVideo > 0) {
                var videoDesc = sdp.substring(indexOfVideo);
                videoDesc = videoDesc.replace(/c=IN (.*)\r\n/, 'c=IN $1\r\nb=' + modifier + ':' + bandwidth + '\r\n');
                sdp = sdp.substring(0, indexOfVideo) + videoDesc;
            }
            // insert b= after c= line.
        } else {
            sdp = sdp.replace(new RegExp('b=' + modifier + ':.*\r\n'), 'b=' + modifier + ':' + bandwidth + '\r\n');
        }
    } else {
        // unlimited: remove b line
        sdp.replace(new RegExp('b=' + modifier + ':.*\r\n'), '');
    }

    Strophe.log("", '[Strophe.jingle] updateBandwidthRestriction to ', bandwidth);

    return sdp;
};

JingleSession.prototype.setRemoteDescription = function(elem, desctype) {
    Strophe.log("", '[Strophe.jingle] setRemoteDescription ', desctype);
    var self = this;
    this.remoteSDP = new SDP('');
    this.remoteSDP.fromJingle(elem);

    if (this.isInitiator) {
        this.remoteSDP.raw = this.remoteSDP.raw.replace(/a=setup:passive/g, "a=setup:active");
    } else {
        this.remoteSDP.raw = this.remoteSDP.raw.replace(/a=setup:active/g, "a=setup:passive");
    }

    //change video codec when on Mac OS to H264
    if (navigator.platform.toUpperCase().indexOf("MAC") >= 0) {
        this.remoteSDP.raw = this.forceCodecTo(this.remoteSDP.raw, "H264/90000", "video");
    }

    if (this.conference_id !== -1 || this.confId || this.publisherId) {
        this.remoteSDP.raw = this.updateBandwidthRestriction(this.remoteSDP.raw, true);
    }
    else {
        //check if the distant user a mobile
        var isMobile = false;
        if (this.peerjid) {
            isMobile = (this.peerjid.indexOf("mobile_android") !== -1 || this.peerjid.indexOf("mobile_ios") !== -1 || this.peerjid.indexOf("deskphone") !== -1);
        }
        this.remoteSDP.raw = this.updateBandwidthRestriction(this.remoteSDP.raw, false, isMobile);
    }

    //activate Discontinuous Transmission (DTX)
    if (this.DTX) {
        Strophe.log("", '[Strophe.jingle] activate Discontinuous Transmission (DTX)');
        this.remoteSDP.raw = this.remoteSDP.raw.replace("useinbandfec=1", "useinbandfec=1;usedtx=1");
    }

    Strophe.log("", '[Strophe.jingle] setRemoteDescription after parsing ' + this.remoteSDP.raw);
    var remotedesc = new window.RTCSessionDescription({ type: desctype, sdp: this.remoteSDP.raw });

    Strophe.log("", '[Strophe.jingle] setRemoteDescription object ', remotedesc);

    this.peerconnection.setRemoteDescription(remotedesc,
        function() {
            Strophe.log("", '[Strophe.jingle] setRemoteDescription success');
            if (self.unifiedPlanActivated) {
                self.localTransceivers = self.peerconnection.getTransceivers();
            }
        },
        function(e) {
            Strophe.log(Strophe.LogLevel.ERROR, '[Strophe.jingle] setRemoteDescription error ' + e);
        }
    );

    Strophe.log("", '[Strophe.jingle] setRemoteDescription is setting, try to update the RTP Sender ');
                
    if (this.ice_config.enableDSCP) {
        this.peerconnection.getSenders().forEach(function(rtpSender) {
            console.error(rtpSender);
            if (rtpSender.getParameters && rtpSender.setParameters) {
                var params = rtpSender.getParameters();
                console.error(params);
                params.encodings.forEach(function(encoding) {
                    encoding.priority = "high";
                    encoding.networkPriority = "high";
                });
                
                rtpSender.setParameters(params);
                console.error(rtpSender.getParameters());
            }
        });
    }
};

JingleSession.prototype.addIceCandidate = function(elem) {
    // Strophe.log("", 'add ice candidate ' + JSON.stringify(event.candidate, null, ' '));
    Strophe.log("", '[Strophe.jingle] addIceCandidate');

    var self = this;

    // operate on each content element
    elem.each(function() {

        ////// to modify
        var idx = -1;
        var i;
        for (i = 0; i < self.remoteSDP.media.length; i++) {
            if (SDPUtil.find_line(self.remoteSDP.media[i], 'a=mid:' + $(this).attr('name')) ||
                self.remoteSDP.media[i].indexOf('m=' + $(this).attr('name')) === 0) {
                idx = i;
                break;
            }
        }
        if (idx == -1) { // fall back to localdescription
            for (i = 0; i < self.localSDP.media.length; i++) {
                if (SDPUtil.find_line(self.localSDP.media[i], 'a=mid:' + $(this).attr('name')) ||
                    self.localSDP.media[i].indexOf('m=' + $(this).attr('name')) === 0) {
                    idx = i;
                    break;
                }
            }
        }

        ////// to modify end
        var name = $(this).attr('name');
        // TODO: check ice-pwd and ice-ufrag?
        // if ($(this).attr('ufrag') && $(this).attr('pwd')) {
        //    Strophe.log(Strophe.LogLevel.ERROR, $(this).attr('ufrag'));
        //    Strophe.log(Strophe.LogLevel.ERROR, $(this).attr('pwd'));
        // }

        var ufrag,
            pwd;

        var network = "",
            id = "";
        // network = $(this).attr('network');
        // id = $(this).attr('id');

        $(this).find('content>transport').each(function() {
            ufrag = this.getAttribute("ufrag");
            pwd = this.getAttribute("pwd");
        });

        $(this).find('transport>candidate').each(function() {
            var line, candidate;
            line = SDPUtil.candidateFromJingle(this, ufrag, pwd);
            candidate = new window.RTCIceCandidate({
                sdpMLineIndex: idx,
                sdpMid: name,
                candidate: line
            });
            try {
                if (candidate && self.iceFilterList && self.iceFilterList.length) {
                    if (self.iceFilterList.indexOf(candidate.type) !== -1) {
                        Strophe.log("", '[Strophe.jingle] Received ICE candidate ' + candidate.type + ' is filtered');
                        return;
                    }
                }
                self.peerconnection.addIceCandidate(candidate);
            } catch (e) {
                Strophe.log(Strophe.LogLevel.ERROR, '[Strophe.jingle] addIceCandidate failed', e.toString(), line);
            }
        });
    });
};

JingleSession.prototype.sendAnswer = function(provisional, type) {
    Strophe.log("", '[Strophe.jingle] sendAnswer', provisional);
    var self = this;
    this.peerconnection.createAnswer(
        function(sdp) {
            self.createdAnswer(sdp, provisional, type);
        },
        function(e) {
            Strophe.log(Strophe.LogLevel.ERROR, '[Strophe.jingle] createAnswer failed', e);
        },
        this.media_constraints
    );
};

JingleSession.prototype.createdAnswer = function(sdp, provisional, type) {
    try {

        Strophe.log("", '[Strophe.jingle] createdAnswer');
        var self = this;


        this.localSDP = new SDP(sdp.sdp);
        //this.localSDP.mangle();
        this.usepranswer = provisional === true;
        var action = type ? type : "session-accept";

        if (type) {
            self.isReconnecting = false;
        }

        Strophe.log("", 'sdp is ' + sdp.sdp);

        var accept = $iq({
            to: this.peerjid,
            type: 'set'
        })
            .c('jingle', {
                xmlns: 'urn:xmpp:jingle:1',
                action: action,
                initiator: this.initiator,
                responder: this.responder,
                sid: this.sid,
                localType: this.localType
            });

        if (this.calledNumber && this.calledNumber !== "") {//callednumber for webrtcGateway-mediaPillar
            accept = accept.c('mediapillar', { xmlns: 'urn:xmpp:janus:1' })
                .c('callednumber')
                .t(this.calledNumber);
            accept.up();
            accept.up();
        }

        this.localSDP.toJingle(accept, this.initiator == this.me ? 'initiator' : 'responder', this.conference_id);
        // this.addConferenceInfo(accept);
        this.connection.sendIQ(accept,
            function() {
                var ack = {};
                ack.source = 'answer';
                $(document).trigger('ack.jingle', [self.sid, ack]);
            },
            function(stanza) {
                var error = ($(stanza).find('error').length) ? {
                    code: $(stanza).find('error').attr('code'),
                    reason: $(stanza).find('error :first')[0].tagName,
                } : {};
                error.source = 'answer';
                $(document).trigger('error.jingle', { sid: self.sid, error: error });
            },
            this.jingleIqTimeout);

        sdp.sdp = this.localSDP.raw;
        this.peerconnection.setLocalDescription(sdp,
            function() {
                $(document).trigger('setLocalDescription.jingle', [self.sid]);

                Strophe.log("", '[Strophe.jingle] createdAnswer -- setLocalDescription success, try to update the RTP Sender ');
                
                if (self.ice_config.enableDSCP) {
                    self.peerconnection.getSenders().forEach(function(rtpSender) {
                        if (rtpSender.getParameters && rtpSender.setParameters) {
                            var params = rtpSender.getParameters();
                            params.encodings.forEach(function(encoding) {
                                encoding.priority = "high";
                                encoding.networkPriority = "high";
                            });
                            
                            rtpSender.setParameters(params);
                            Strophe.log("", '[Strophe.jingle] RTP Sender parameters are updated ' + rtpSender.getParameters());
                        }
                    });
                }
            },
            function(e) {
                Strophe.log(Strophe.LogLevel.ERROR, '[Strophe.jingle] setLocalDescription failed', e);
            }
        );
        var cands = SDPUtil.find_lines(this.localSDP.raw, 'a=candidate:');
        for (var j = 0; j < cands.length; j++) {
            var cand = SDPUtil.parse_icecandidate(cands[j]);
            if (cand.type == 'srflx') {
                this.hadstuncandidate = true;
            } else if (cand.type == 'relay') {
                this.hadturncandidate = true;
            }
        }
    } catch (error) {
        Strophe.log(Strophe.LogLevel.ERROR, '[Strophe.jingle] JingleSession.prototype.createdAnswer failed: ' + error);
    }
};

JingleSession.prototype.sendTerminate = function(reason, text) {
    try {

        var self = this,
            term = $iq({
                to: this.peerjid,
                type: 'set'
            })
                .c('jingle', {
                    xmlns: 'urn:xmpp:jingle:1',
                    action: 'session-terminate',
                    initiator: this.initiator,
                    sid: this.sid
                })
                .c('reason')
                .c(reason || 'success');

        if (text) {
            term.up().c('text').t(text);
        }

        this.connection.sendIQ(term,
            function() {
                if (self.peerconnection && (self.peerconnection.signalingState !== 'closed' || self.peerconnection.signalingState == 'undefined')) {
                    self.peerconnection.close();
                    self.terminate();
                }
                Strophe.log("", '[Strophe.jingle] Clear peerconnection');
                self.peerconnection = null;
                var ack = {};
                ack.source = 'terminate';
                $(document).trigger('ack.jingle', [self.sid, ack]);
            },
            function(stanza) {
                var error = ($(stanza).find('error').length) ? {
                    code: $(stanza).find('error').attr('code'),
                    reason: $(stanza).find('error :first')[0].tagName,
                } : {};
                $(document).trigger('ack.jingle', [self.sid, error]);
            },
            this.jingleIqTimeout);
        if (this.statsinterval !== null) {
            window.clearInterval(this.statsinterval);
            this.statsinterval = null;
        }
    } catch (error) {
        Strophe.log(Strophe.LogLevel.ERROR, '[Strophe.jingle] JingleSession.prototype.sendTerminate failed: ' + error);
    }
};

