JingleSession.prototype.forceCodecTo = function(sdp, codecToForce, media) {

    var splittedSDP = sdp.split('\r\n'),
        indexVideo = -1,
        indexPos = -1,
        codec = [],
        list = [],
        from, to, codecName, indexFound, j;

    for (var i = 0, l = splittedSDP.length; i < l; i++) {

        var line = splittedSDP[i];

        if (line.indexOf('m=' + media) > -1) {
            indexVideo = i;
            indexPos = line.indexOf('RTP/SAVPF') + 10;
            list = line.substring(indexPos).split(" ");
        }

        if (line.indexOf(codecToForce) > -1) {
            from = line.indexOf(':');
            to = line.indexOf(' ');
            codecName = line.substring(from + 1, to);
            indexFound = -1;
            codec.push(codecName);
            //Remove from list
            for (j = 0; j < list.length; j++) {
                if (list[j] === codecName) {
                    indexFound = j;
                    break;
                }
            }
            if (indexFound > -1) {
                list.splice(indexFound, 1);
            }
        }

        if (codecToForce === 'PCMU/8000') {
            // Do it again with the second codec
            if (line.indexOf('PCMA/8000') > -1) {
                from = line.indexOf(':');
                to = line.indexOf(' ');
                codecName = line.substring(from + 1, to);
                indexFound = -1;
                codec.push(codecName);
                //Remove from list
                for (j = 0; j < list.length; j++) {
                    if (list[j] === codecName) {
                        indexFound = j;
                        break;
                    }
                }
                if (indexFound > -1) {
                    list.splice(indexFound, 1);
                }
            }
        }
    }

    if (indexVideo !== -1) {
        splittedSDP[indexVideo] = splittedSDP[indexVideo].substr(0, indexPos - 1);
        // Add  requested codec first
        for (var k = 0; k < codec.length; k++) {
            splittedSDP[indexVideo] += " " + codec[k];
        }

        if (list.length > 0) {
            splittedSDP[indexVideo] += " " + list.join(' ');
        }

        sdp = splittedSDP.join('\r\n');
    }
    
    return sdp;
};

// Helper method to munge an SDP to enable simulcasting (Chrome only)
JingleSession.prototype.mungeSdpForSimulcasting = function(sdp) {
    // Let's munge the SDP to add the attributes for enabling simulcasting
    // (based on https://gist.github.com/ggarber/a19b4c33510028b9c657)
    var lines = sdp.split("\r\n");
    var video = false;
    var ssrc = [ -1 ], ssrc_fid = [ -1 ];
    var cname = null, msid = null, mslabel = null, label = null;
    var insertAt = -1;
    for(var i=0; i<lines.length; i++) {
        var mline = lines[i].match(/m=(\w+) */);
        if(mline) {
            var medium = mline[1];
            if(medium === "video") {
                // New video m-line: make sure it's the first one
                if(ssrc[0] < 0) {
                    video = true;
                } else {
                    // We're done, let's add the new attributes here
                    insertAt = i;
                    break;
                }
            } else {
                // New non-video m-line: do we have what we were looking for?
                if(ssrc[0] > -1) {
                    // We're done, let's add the new attributes here
                    insertAt = i;
                    break;
                }
            }
            continue;
        }
        if(!video)
            continue;
        var fid = lines[i].match(/a=ssrc-group:FID (\d+) (\d+)/);
        if(fid) {
            ssrc[0] = fid[1];
            ssrc_fid[0] = fid[2];
            lines.splice(i, 1); i--;
            continue;
        }
        if(ssrc[0]) {
            var match = lines[i].match('a=ssrc:' + ssrc[0] + ' cname:(.+)')
            if(match) {
                cname = match[1];
            }
            match = lines[i].match('a=ssrc:' + ssrc[0] + ' msid:(.+)')
            if(match) {
                msid = match[1];
            }
            match = lines[i].match('a=ssrc:' + ssrc[0] + ' mslabel:(.+)')
            if(match) {
                mslabel = match[1];
            }
            match = lines[i].match('a=ssrc:' + ssrc[0] + ' label:(.+)')
            if(match) {
                label = match[1];
            }
            if(lines[i].indexOf('a=ssrc:' + ssrc_fid[0]) === 0) {
                lines.splice(i, 1); i--;
                continue;
            }
            if(lines[i].indexOf('a=ssrc:' + ssrc[0]) === 0) {
                lines.splice(i, 1); i--;
                continue;
            }
        }
        if(lines[i].length == 0) {
            lines.splice(i, 1); i--;
            continue;
        }
    }
    if(ssrc[0] < 0) {
        // Couldn't find a FID attribute, let's just take the first video SSRC we find
        insertAt = -1;
        video = false;
        for(var i=0; i<lines.length; i++) {
            var mline = lines[i].match(/m=(\w+) */);
            if(mline) {
                var medium = mline[1];
                if(medium === "video") {
                    // New video m-line: make sure it's the first one
                    if(ssrc[0] < 0) {
                        video = true;
                    } else {
                        // We're done, let's add the new attributes here
                        insertAt = i;
                        break;
                    }
                } else {
                    // New non-video m-line: do we have what we were looking for?
                    if(ssrc[0] > -1) {
                        // We're done, let's add the new attributes here
                        insertAt = i;
                        break;
                    }
                }
                continue;
            }
            if(!video)
                continue;
            if(ssrc[0] < 0) {
                var value = lines[i].match(/a=ssrc:(\d+)/);
                if(value) {
                    ssrc[0] = value[1];
                    lines.splice(i, 1); i--;
                    continue;
                }
            } else {
                var match = lines[i].match('a=ssrc:' + ssrc[0] + ' cname:(.+)')
                if(match) {
                    cname = match[1];
                }
                match = lines[i].match('a=ssrc:' + ssrc[0] + ' msid:(.+)')
                if(match) {
                    msid = match[1];
                }
                match = lines[i].match('a=ssrc:' + ssrc[0] + ' mslabel:(.+)')
                if(match) {
                    mslabel = match[1];
                }
                match = lines[i].match('a=ssrc:' + ssrc[0] + ' label:(.+)')
                if(match) {
                    label = match[1];
                }
                if(lines[i].indexOf('a=ssrc:' + ssrc_fid[0]) === 0) {
                    lines.splice(i, 1); i--;
                    continue;
                }
                if(lines[i].indexOf('a=ssrc:' + ssrc[0]) === 0) {
                    lines.splice(i, 1); i--;
                    continue;
                }
            }
            if(lines[i].length == 0) {
                lines.splice(i, 1); i--;
                continue;
            }
        }
    }
    if(ssrc[0] < 0) {
        // Still nothing, let's just return the SDP we were asked to munge
        Janus.warn("Couldn't find the video SSRC, simulcasting NOT enabled");
        return sdp;
    }
    if(insertAt < 0) {
        // Append at the end
        insertAt = lines.length;
    }
    // Generate a couple of SSRCs (for retransmissions too)
    // Note: should we check if there are conflicts, here?
    ssrc[1] = Math.floor(Math.random()*0xFFFFFFFF);
    ssrc[2] = Math.floor(Math.random()*0xFFFFFFFF);
    ssrc_fid[1] = Math.floor(Math.random()*0xFFFFFFFF);
    ssrc_fid[2] = Math.floor(Math.random()*0xFFFFFFFF);
    // Add attributes to the SDP
    for(var i=0; i<ssrc.length; i++) {
        if(cname) {
            lines.splice(insertAt, 0, 'a=ssrc:' + ssrc[i] + ' cname:' + cname);
            insertAt++;
        }
        if(msid) {
            lines.splice(insertAt, 0, 'a=ssrc:' + ssrc[i] + ' msid:' + msid);
            insertAt++;
        }
        if(mslabel) {
            lines.splice(insertAt, 0, 'a=ssrc:' + ssrc[i] + ' mslabel:' + mslabel);
            insertAt++;
        }
        if(label) {
            lines.splice(insertAt, 0, 'a=ssrc:' + ssrc[i] + ' label:' + label);
            insertAt++;
        }
        // Add the same info for the retransmission SSRC
        if(cname) {
            lines.splice(insertAt, 0, 'a=ssrc:' + ssrc_fid[i] + ' cname:' + cname);
            insertAt++;
        }
        if(msid) {
            lines.splice(insertAt, 0, 'a=ssrc:' + ssrc_fid[i] + ' msid:' + msid);
            insertAt++;
        }
        if(mslabel) {
            lines.splice(insertAt, 0, 'a=ssrc:' + ssrc_fid[i] + ' mslabel:' + mslabel);
            insertAt++;
        }
        if(label) {
            lines.splice(insertAt, 0, 'a=ssrc:' + ssrc_fid[i] + ' label:' + label);
            insertAt++;
        }
    }
    lines.splice(insertAt, 0, 'a=ssrc-group:FID ' + ssrc[2] + ' ' + ssrc_fid[2]);
    lines.splice(insertAt, 0, 'a=ssrc-group:FID ' + ssrc[1] + ' ' + ssrc_fid[1]);
    lines.splice(insertAt, 0, 'a=ssrc-group:FID ' + ssrc[0] + ' ' + ssrc_fid[0]);
    lines.splice(insertAt, 0, 'a=ssrc-group:SIM ' + ssrc[0] + ' ' + ssrc[1] + ' ' + ssrc[2]);
    sdp = lines.join("\r\n");
    if(!sdp.endsWith("\r\n"))
        sdp += "\r\n";
    return sdp;
};

JingleSession.prototype.getStats = function(interval) {
    var self = this;
    var recv = { audio: 0, video: 0 };
    var lost = { audio: 0, video: 0 };
    var lastrecv = { audio: 0, video: 0 };
    var lastlost = { audio: 0, video: 0 };
    var loss = { audio: 0, video: 0 };
    var delta = { audio: 0, video: 0 };
    var bytesSent = { audio: 0, video: 0 };
    var bytesReceived = { audio: 0, video: 0 };

    var sec = interval / 1000;

    var isFirstTime = true;
    var lastNumberPacketsLostAudio = 0;
    var lastNumberPacketsReceivedAudio = 0;
    var iteration = 0;
    var globalMOS = 0;
    var globalRTT = 0;
    var globalJitter = 0;
    var globalJitterDepth = 0;
    var maxRTT = 0;
    var maxJitter = 0;
    var maxJitterDepth = 0;

    var candidatePair = "";
    var newStat = { bitrate: {}};
    var networkType = "";
    var localCandidateIp = "";
    var remoteCandidateIp = "";


    var processGoogleChromeStats = function(items) {
        $(document).trigger('statsChrome.jingle', [self.sid, items]);

        var packetsAudioSent = 0;
        var packetsVideoSent = 0;

        var packetsAudioReceived = 0;
        var packetsVideoReceived = 0;

        var packetsAudioSentLost = 0;
        var packetsVideoSentLost = 0;

        var packetsAudioReveicedLost = 0;
        var packetsVideoReveicedLost = 0;

        var frameRateSent = 0;
        var frameRateReceived = 0;

        var audioKBSent = 0;
        var videoKBSent = 0;

        var audioKBReceived = 0;
        var videoKBReceived = 0;

        var data = new Object();

        var stats = [];

        var audioInputLevel = 0;
        var audioOutputLevel = 0;

        //MOS Calculation
        var googRTTAudio = 0;
        var googJitterBufferMsAudio = 0;
        var googJitterReceived = 0;
        var mosPacketsReceivedAudio = 0;
        var mosPacketsLostAudio = 0;
        var Rx = 0;
        var Ry = 0;
        var d = 0;
        var Id = 0;
        var R = 0;
        var MOS = 0;


        var flagSendAudio = false;
        var flagSendVideo = false;
        var flagRecvAudio = false;
        var flagRecvVideo = false;

        //after renego, there're multiple ssrc, always take the last one
        for (var i = items.length -1; i >= 0 ; i--) {
            if (items[i].type == 'ssrc') {
                if (items[i].id.indexOf("send") !== -1 ) {
                    //sending flow
                    if ((items[i].googCodecName === 'opus' || items[i].googCodecName === 'PCMA') && !flagSendAudio) {
                        flagSendAudio = true;
                        //audio src
                        packetsAudioSent = items[i].packetsSent;
                        packetsAudioSentLost += items[i].packetsLost;
                        audioInputLevel = items[i].audioInputLevel;

                        if (items[i].googRtt && !googRTTAudio) {
                            googRTTAudio = parseInt(items[i].googRtt, 10); 
                        }

                        if (!bytesSent.audio) {
                            bytesSent.audio = items[i].bytesSent;
                        }

                        var bytes = items[i].bytesSent - bytesSent.audio;
                        bytesSent.audio = items[i].bytesSent;

                        audioKBSent = (bytes * 8) / (1024 * sec);
                    }
                    else if (items[i].googCodecName == 'VP8' && !flagSendVideo) {
                        flagSendVideo = true;
                        //video src
                        packetsVideoSent = items[i].packetsSent;
                        packetsVideoSentLost += items[i].packetsLost;

                        if (items[i].googFrameRateSent) {
                            frameRateSent = items[i].googFrameRateSent;
                        }

                        if (!bytesSent.video) {
                            bytesSent.video = items[i].bytesSent;
                        }

                        if (items[i].googRtt && !googRTTAudio) {
                            googRTTAudio = parseInt(items[i].googRtt, 10); 
                        }

                        var bytes = items[i].bytesSent - bytesSent.video;
                        bytesSent.video = items[i].bytesSent;

                        videoKBSent = (bytes * 8) / (1024 * sec);
                    }

                } else {
                    //receiving flow
                    if ((items[i].googCodecName === 'opus' || items[i].googCodecName === 'PCMA') && !flagRecvAudio) {
                        flagRecvAudio = true;
                        packetsAudioReceived = items[i].packetsReceived;
                        packetsAudioReveicedLost += items[i].packetsLost;
                        audioOutputLevel = items[i].audioOutputLevel;

                        lastlost.audio = lost.audio;
                        lastrecv.audio = recv.audio;
                        recv.audio = parseInt(packetsAudioReceived, 10);
                        lost.audio = parseInt(packetsAudioReveicedLost, 10);

                        googJitterBufferMsAudio = parseInt(items[i].googJitterBufferMs, 10);
                        googJitterReceived = parseInt(items[i].googJitterReceived, 10);

                        mosPacketsReceivedAudio = parseInt(items[i].packetsReceived, 10) - lastNumberPacketsReceivedAudio;
                        lastNumberPacketsReceivedAudio = parseInt(items[i].packetsReceived, 10);

                        if (mosPacketsReceivedAudio < 0) {
                            mosPacketsReceivedAudio = 0;
                        }

                        mosPacketsLostAudio = parseInt(items[i].packetsLost, 10) - lastNumberPacketsLostAudio;
                        lastNumberPacketsLostAudio = parseInt(items[i].packetsLost, 10);

                        if (mosPacketsLostAudio < 0) {
                            mosPacketsLostAudio = 0;
                        }

                        if (!bytesReceived.audio) {
                            bytesReceived.audio = items[i].bytesReceived;
                        }

                        var bytes = items[i].bytesReceived - bytesReceived.audio;
                        bytesReceived.audio = items[i].bytesReceived;

                        audioKBReceived = (bytes * 8) / (1024 * sec);
                    }
                    else if (items[i].googCodecName == 'VP8' && !flagRecvVideo) {
                        flagRecvVideo = true;
                        packetsVideoReceived = items[i].packetsReceived;
                        packetsVideoReveicedLost += items[i].packetsLost;

                        if (items[i].googFrameRateReceived) {
                            frameRateReceived = items[i].googFrameRateReceived;
                        }

                        lastlost.video = lost.video;
                        lastrecv.video = recv.video;
                        recv.video = parseInt(packetsVideoReceived, 10);
                        lost.video = parseInt(packetsVideoReveicedLost, 10);

                        if (!bytesReceived.video) {
                            bytesReceived.video = items[i].bytesReceived;
                        }

                        var bytes = items[i].bytesReceived - bytesReceived.video;
                        bytesReceived.video = items[i].bytesReceived;

                        videoKBReceived = (bytes * 8) / (1024 * sec);
                    }
                }
            }

            if (items[i].type == "googCandidatePair" && items[i].googWritable === "true" && isFirstTime) {
                //get the active peer connection
                data.localCandidateType = items[i].googLocalCandidateType;
                data.localAddress = items[i].googLocalAddress;
                data.localTransportType = items[i].googTransportType;
                data.remoteCandidateType = items[i].googRemoteCandidateType;
                data.remoteAddress = items[i].googRemoteAddress;

                localCandidateIp = items[i].googLocalAddress.split(":")[0];
                remoteCandidateIp = items[i].googRemoteAddress.split(":")[0];

                candidatePair = data.localAddress + " [ " + data.localCandidateType + " ] <-> " + data.remoteAddress + " [ " + data.remoteCandidateType + " ] || " + data.localTransportType; 
            }

            if (items[i].type === "localcandidate" && items[i].ipAddress === localCandidateIp) {
                data.networkType = items[i].networkType;
                networkType = data.networkType;
            }


            //filter empty google candidate pairs
            if (items[i].type === "googCandidatePair" && items[i].requestsReceived === "0") {
                //do nothing
            }
            //filter other unused data
            else if (items[i].type === "remotecandidate" || items[i].type === "localcandidate" || 
                    items[i].type === "googCertificate" || items[i].type === "googComponent" || 
                    items[i].type === "googTrack" || items[i].type === "googLibjingleSession" ||
                    items[i].type === "VideoBwe") {
                //do nothing
            }
            else {
                stats.push(items[i]);
            }

            var res = items[i];
            var inStats = false;
            // Check if these are statistics on incoming media
            if((res.mediaType === "video" || res.id.toLowerCase().indexOf("video") > -1) &&
                    res.type === "inbound-rtp" && res.id.indexOf("rtcp") < 0) {
                // New stats
                inStats = true;
            } else if(res.type == 'ssrc' && res.bytesReceived &&
                    (res.googCodecName === "VP8" || res.googCodecName === "")) {
                // Older Chromer versions
                inStats = true;
            }
            // Parse stats now
            if (inStats) {
                newStat.bitrate.bsnow = res.bytesReceived;
                newStat.bitrate.tsnow = res.timestamp;
                if(newStat.bitrate.bsbefore === undefined || newStat.bitrate.tsbefore === undefined) {
                    // Skip this round
                    newStat.bitrate.bsbefore = newStat.bitrate.bsnow;
                    newStat.bitrate.tsbefore = newStat.bitrate.tsnow;
                } else {
                    // Calculate bitrate
                    var timePassed = newStat.bitrate.tsnow - newStat.bitrate.tsbefore;
                    if(adapter.default.browserDetails.browser == "safari")
                        timePassed = timePassed/1000;	// Apparently the timestamp is in microseconds, in Safari
                    var bitRate = Math.round((newStat.bitrate.bsnow - newStat.bitrate.bsbefore) * 8 / timePassed);
                    if(adapter.default.browserDetails.browser === 'safari')
                        bitRate = parseInt(bitRate/1000);
                        newStat.bitrate.value = bitRate + ' kbits/sec';
                    //~ Janus.log("Estimated bitrate is " + config.bitrate.value);
                    newStat.bitrate.bsbefore = newStat.bitrate.bsnow;
                    newStat.bitrate.tsbefore = newStat.bitrate.tsnow;

                    
                    $(document).trigger('webrtcSessionBitRate.jingle', [self.sid, newStat.bitrate]);
                }
            }
        }

        //Calculate MOS
        if (mosPacketsReceivedAudio) {
            Rx = 93.2 - mosPacketsLostAudio/mosPacketsReceivedAudio;
            Ry = 0.18*Rx*Rx -27.9*Rx + 1126.62;
        }

        if (googRTTAudio && googJitterReceived) {
            d = googRTTAudio/2 + googJitterReceived;
        }
        
        var H = (d - 177.3 < 0) ? 0 : 1;
        Id = 0.024*d + 0.11*(d-177.3)*H;
        R = Ry - Id;

        if (R < 0) {
            MOS = 1;
        }
        else if (R > 100) {
            MOS = 4.5;
        }
        else {
            MOS = 1 + 0.035*R + R*(R - 60)*(100 - R)*7*0.000001;
        }

        data.googRTTAudio = googRTTAudio;
        data.googJitterBufferMsAudio = googJitterBufferMsAudio;
        data.googJitterReceived = googJitterReceived;
        data.mosPacketsReceivedAudio = mosPacketsReceivedAudio;
        data.mosPacketsLostAudio = mosPacketsLostAudio;
        data.MOS = MOS;
        data.candidatePair = candidatePair;

        if (MOS) {
            iteration += 1;
            globalMOS += MOS;
            globalRTT += googRTTAudio;
            globalJitter += googJitterReceived;
            globalJitterDepth += googJitterBufferMsAudio;
            data.iteration = iteration;
            data.meanMOS = globalMOS/iteration;
            data.meanRTT = globalRTT/iteration;
            data.meanJitter = globalJitter/iteration;
            data.meanJitterDepth = globalJitterDepth/iteration;

            maxRTT = (maxRTT < googRTTAudio) ? googRTTAudio : maxRTT;
            maxJitter = (maxJitter < googJitterReceived) ? googJitterReceived : maxJitter;
            maxJitterDepth = (maxJitterDepth < googJitterBufferMsAudio) ? googJitterBufferMsAudio : maxJitterDepth;
            
            data.maxRTT = maxRTT;
            data.maxJitter = maxJitter;
            data.maxJitterDepth = maxJitterDepth;
        }

        //audio data
        data.packetsAudioSent = parseInt(packetsAudioSent, 10);
        data.packetsAudioReceived = parseInt(packetsAudioReceived, 10);
        data.audioInputLevel = parseInt(audioInputLevel, 10);
        data.audioOutputLevel = parseInt(audioOutputLevel, 10);

        //video data
        data.packetsVideoSent = parseInt(packetsVideoSent, 10);
        data.packetsVideoReceived = parseInt(packetsVideoReceived, 10);

        data.bytesSent = bytesSent;
        data.bytesReceived = bytesReceived;

        if (data.localCandidateType) {
            isFirstTime = false;
            $(document).trigger('webrtcConnectionType.jingle', [self.sid, data]);
        }

        stats.RainMetrics = {
            type: "mscore",
            meanRTT: data.meanRTT,
            maxRTT: data.maxRTT,
            meanJitter: data.meanJitter,
            maxJitter: data.maxJitter,
            meanJitterDepth: data.meanJitterDepth,
            maxJitterDepth: data.maxJitterDepth,
            candidatePair: data.candidatePair,
            networkType: networkType,
            meanMOS: data.meanMOS
        };

        $(document).trigger('webrtcSessionStats.jingle', [self.sid, stats]);
        $(document).trigger('webrtcSessionStatsSimplyfied.jingle', [self.sid, data]);

        if (data) {
            Strophe.log("", "[Strophe.jingle] webrtcChromeStats audio packets received : " + data.packetsAudioReceived + " / audio packets sent : " + data.packetsAudioSent + " / for session " + self.sid);
        }
    };

    var processFirefoxStats = function(items) {

        $(document).trigger('statsFirefox.jingle', [self.sid, items]);
        
        var data = new Object();
        var audioKBReceived = 0;
        var videoKBReceived = 0;

        var localCandidateId;
        var remoteCandidateId;

        var stats = [];

        for (var i = 0; i < items.length; ++i) {
            if (items[i].mediaType == 'audio' && items[i].bytesReceived) {
                if (!bytesReceived.audio) {
                    bytesReceived.audio = items[i].bytesReceived;
                }

                var bytes = items[i].bytesReceived - bytesReceived.audio;
                bytesReceived.audio = items[i].bytesReceived;
                audioKBReceived = (bytes * 8) / (1024 * sec);

                data.audioReceived = {
                    bytesReceived: bytesReceived.audio,
                    packetsLost: items[i].packetsLost,
                    packetsReceived: items[i].packetsReceived
                };
            }

            else if (items[i].mediaType == 'audio' && items[i].bytesSent) {
                data.audioSent = {
                    bytesSent: items[i].bytesSent,
                    packetsSent: items[i].packetsSent
                };
            }

            else if (items[i].mediaType == 'video' && items[i].bytesReceived) {
                if (!bytesReceived.video) {
                    bytesReceived.video = items[i].bytesReceived;
                }
                var bytes = items[i].bytesReceived - bytesReceived.video;
                bytesReceived.video = items[i].bytesReceived;

                if (bytes) {
                    videoKBReceived = (bytes * 8) / (1024 * sec);
                } else {
                    videoKBReceived = 0;
                }

                data.videoReceived = {
                    bytesReceived: bytesReceived.video,
                    packetsLost: items[i].packetsLost,
                    packetsReceived: items[i].packetsReceived
                };
            }

            //send video
            else if (items[i].mediaType == 'video' && items[i].bytesSent) {

                data.videoSent = {
                    bytesSent: items[i].bytesSent,
                    packetsSent: items[i].packetsSent
                };
                //Strophe.log("", "[JingleSession] Bitrate Mean: " + items[i].bitrateMean);
            }

            if (items[i].type === "candidate-pair" && items[i].state === "succeeded" && items[i].selected === true) {
                localCandidateId = items[i].localCandidateId;
                remoteCandidateId = items[i].remoteCandidateId;
            }


            if (isFirstTime && items[i].type === "localcandidate" && items[i].id === localCandidateId) {
                if (!data.connectionType) {
                    data.connectionType = {};
                }

                data.connectionType.local = {
                    candidateType: items[i].candidateType,
                    ipAddress: items[i].ipAddress + ":" + items[i].portNumber,
                    transport: items[i].transport
                };
            }

            if (isFirstTime && items[i].type === "remotecandidate" && items[i].id === remoteCandidateId) {
                if (!data.connectionType) {
                    data.connectionType = {};
                }

                data.connectionType.remote = {
                    candidateType: items[i].candidateType,
                    ipAddress: items[i].ipAddress + ":" + items[i].portNumber
                };

            }

            if (items[i].type === "candidate-pair" && !items[i].selected) {
                //ignore
            } 
            else if ((items[i].type === "local-candidate" && items[i].id !== localCandidateId) || (items[i].type === "remote-candidate" && items[i].id !== remoteCandidateId)) {
               //ignore 
            }
            else {
                stats.push(items[i]);
            }

            var res = items[i];
            var inStats = false;
            // Check if these are statistics on incoming media
            if((res.mediaType === "video" || res.id.toLowerCase().indexOf("video") > -1) &&
                    res.type === "inbound-rtp" && res.id.indexOf("rtcp") < 0) {
                // New stats
                inStats = true;
            } else if(res.type == 'ssrc' && res.bytesReceived &&
                    (res.googCodecName === "VP8" || res.googCodecName === "")) {
                // Older Chromer versions
                inStats = true;
            }
            // Parse stats now
            if(inStats) {
                newStat.bitrate.bsnow = res.bytesReceived;
                newStat.bitrate.tsnow = res.timestamp;
                if(newStat.bitrate.bsbefore === undefined || newStat.bitrate.tsbefore === undefined) {
                    // Skip this round
                    newStat.bitrate.bsbefore = newStat.bitrate.bsnow;
                    newStat.bitrate.tsbefore = newStat.bitrate.tsnow;
                } else {
                    // Calculate bitrate
                    var timePassed = newStat.bitrate.tsnow - newStat.bitrate.tsbefore;
                    if(adapter.default.browserDetails.browser == "safari")
                        timePassed = timePassed/1000;	// Apparently the timestamp is in microseconds, in Safari
                    var bitRate = Math.round((newStat.bitrate.bsnow - newStat.bitrate.bsbefore) * 8 / timePassed);
                    if(adapter.default.browserDetails.browser === 'safari')
                        bitRate = parseInt(bitRate/1000);
                        newStat.bitrate.value = bitRate + ' kbits/sec';
                    //~ Janus.log("Estimated bitrate is " + config.bitrate.value);
                    newStat.bitrate.bsbefore = newStat.bitrate.bsnow;
                    newStat.bitrate.tsbefore = newStat.bitrate.tsnow;

                    
                    $(document).trigger('webrtcSessionBitRate.jingle', [self.sid, newStat.bitrate]);
                }
            }
        }

        data.availableIncomingAudioBandwidth = audioKBReceived;
        data.availableIncomingVideoBandwidth = videoKBReceived;

        if (data.connectionType) {
            isFirstTime = false;
            $(document).trigger('webrtcConnectionType.jingle', [self.sid, data.connectionType]);
        }

        $(document).trigger('webrtcFirefoxStats.jingle', [self.sid, data]);
    }

    if (this.statsinterval) {
        window.clearInterval(this.statsinterval);
        this.statsinterval = null;
    }

    if (this.ice_config.debugWeRTC) {
        interval = 1000;
    }

    this.statsinterval = window.setInterval(function() {
        if (!self || !self.peerconnection) {
            Strophe.log("", "[Strophe.jingle] getStats no peerconnection");
            return;
        }

        if (!!navigator.mozGetUserMedia) {
            self.peerconnection.getStats()
                .then(function(res) {
                    var items = [];
                    res.forEach(function(result) {
                        items.push(result);
                    });
                    processFirefoxStats(items);
                });
        } else if (self.peerconnection.getStats) {
            self.peerconnection.getStats(function(res) {
                var items = [];
                res.result().forEach(function(result) {
                    var item = {};
                    result.names().forEach(function(name) {
                        item[name] = result.stat(name);
                    });
                    item.id = result.id;
                    item.type = result.type;
                    item.timestamp = result.timestamp;
                    items.push(item);
                });
                processGoogleChromeStats(items);
            });
        }
        else {
            Strophe.log("", "[Strophe.jingle] getStats does not exist...");
        }
    }, interval || 1000);

    return this.statsinterval;
};
